<?php// NeWorld Manager 开始// 引入文件require_once  ROOTDIR . '/modules/addons/NeWorld/library/class/NeWorld.Common.Class.php';// NeWorld Manager 结束function f2falipay_MetaData() {    return [        'DisplayName' => '支付宝 (NeWorld)',        'APIVersion' => '2.8',        'DisableLocalCredtCardInput' => true,        'TokenisedStorage' => false,    ];}function f2falipay_config() {	$systemURL = \WHMCS\Config\Setting::getValue('SystemURL');	    $configarray = [    	"FriendlyName" => [			"Type"   => "System",			"Value"  => "支付宝（NeWorld）"		],        "alipay_type" => [            "FriendlyName" => "选择产品",            "Type" => "dropdown",            "Options" => [                "f2falipay" => "当面付（扫码支付）",                "pagepay" => "电脑网站支付",                "allpay" => "当面付 + 电脑网站支付",            ],            "Description" => '仅限于支付宝开放平台 <strong style="color: #cc0000">已签约产品</strong> 使用：<a href="https://doc.open.alipay.com/doc2/detail?treeId=194&articleId=105072&docType=1" target="_blank">当面付</a>、<a href="https://doc.open.alipay.com/docs/doc.htm?treeId=270&articleId=105898&docType=1" target="_blank">电脑网站支付</a>',        ],		"app_id" => [			"FriendlyName" => "应用ID",			"Type" => "text",			"Size" => "25",		],		"merchant_private_key" => [			"FriendlyName" => "商户私钥",            'Type' => 'textarea',            'Rows' => '9',            'Description' => '<script src="../modules/gateways/f2falipay/templates/assets/js/setPrivateKey.js?v9"></script><link href="../modules/gateways/f2falipay/templates/assets/css/style.css?v10" rel="stylesheet" type="text/css"><a class="btn btn-success btn-xs" onClick="javascript:setPrivateKey(\''.$systemURL.'\', \'SHA1\');">生成 SHA1 私钥</a> <a class="btn btn-success btn-xs" onClick="javascript:setPrivateKey(\''.$systemURL.'\', \'SHA256\');">生成 SHA2 私钥</a> 需要服务器安装 <code>openSSL</code> 模块',		],		"alipay_public_key" => [			"FriendlyName" => "支付宝公钥",            'Type' => 'textarea',            'Rows' => '9',            'Description' => '支付宝公钥, 查看地址：https://openhome.alipay.com/platform/keyManage.htm 对应APPID下的支付宝公钥',		],        "sign_type" => [            "FriendlyName" => "加签方式",            "Type" => "dropdown",            "Options" => [                "RSA2" => "RSA2(SHA256)",                "RSA" => "RSA1(SHA1)",            ],            "Description" => '开放平台支持的签名算法！2018年以后开通的 当面付 请选择 RSA2 加签方式！',        ],		"Detail" => [			"FriendlyName" => "显示明细",			"Type" => "yesno",			"Description" => "勾选后支付宝账单将显示产品明细(仅限扫码时可用)。",		],		"isMobile" => [			"FriendlyName" => "启用移动端",			"Type" => "yesno",			"Description" => "勾选后移动端界面自动转向支付宝唤醒页面。",		],		"checkTime" => [			"FriendlyName" => "检查时间",			"Type" => "text",			"Size" => "5",			"Default" => "5",			"Description" => "单位：秒 支付状态检查间隔。",		],		"logs" => [			"FriendlyName" => "启用日志",			"Type" => "yesno",			"Description" => "勾选启用支付回调日志记录。",		],		"hbfq" => [			"FriendlyName" => "启用花呗分期",			"Type" => "yesno",			"Description" => '勾选启用花呗分期，每次交易都可分期，启用时请确保商家账户 <strong style="color: #cc0000">已经拥有花呗分期</strong> 的功能。',		],    ];    	$hbfq = \Illuminate\Database\Capsule\Manager::table('tblpaymentgateways')->where('gateway', 'f2falipay')->where('setting', 'hbfq')->first()->value;	if (!empty($hbfq)) {		$configarray["hbfqsp"] = [			"FriendlyName" => "承担收费比例",            "Type" => "dropdown",            "Options" => [                "100" => "商家承担手续费",                "0" => "用户承担手续费",            ],			"Description" => "分期手续费由商家或用户承担分期手续费。",		];	}	return $configarray;}function f2falipay_link($params) {	if ( !function_exists('scandir') ) {		return '请启用 scandir 函数';	}	if (stristr($_SERVER['PHP_SELF'], 'viewinvoice')) {	# Invoice Variables		$subject = $params["description"];		$description = $params["description"];		$amount = $params['amount']; # Format: ##.##		$invoiceid = date('YmdH').$params['invoiceid'];		# System Variables		$companyname 		= $params['companyname'];		$systemurl 			= $params['systemurl'];		$currency 			= $params['currency'];				// (必填) 商户网站订单系统中唯一订单号，64个字符以内，只能包含字母、数字、下划线，		// 需保证商户系统端不能重复，建议通过数据库sequence生成，		$outTradeNo = $invoiceid;		// (必填) 订单标题，粗略描述用户的支付目的。如“xxx品牌xxx门店当面付扫码消费”		$subject = $subject;		// (必填) 订单总金额，单位为元，不能超过1亿元		// 如果同时传入了【打折金额】,【不可打折金额】,【订单总金额】三者,则必须满足如下条件:【订单总金额】=【打折金额】+【不可打折金额】		$totalAmount = $amount;		// 订单描述，可以对交易或商品进行一个详细地描述，比如填写"购买商品2件共15.00元"		$body = $description;				$result['invoiceid'] 	= $invoiceid;		$result['returnurl'] 	= $params['returnurl'];		$result['checkTime'] 	= $params['checkTime'] * 1000;				$providerId = "2088511558242685"; //系统商pid,作为系统商返佣数据提取的依据				if ( $params['hbfq'] == 'on' ) {			$HbFqNum = $params['hbfqnum'];			$HbFqSellerPercent = $params['hbfqsp'];		}		header("Content-type: text/html; charset=utf-8");				if ( $params['alipay_type'] == 'pagepay' or $params['alipay_type'] == 'allpay' ) {			require_once __DIR__.'/f2falipay/config/pagepayconfig.php';			require_once __DIR__.'/f2falipay/pagepay/model/AlipayTradePagePayContentBuilder.php';			require_once __DIR__.'/f2falipay/pagepay/service/AlipayTradeService.php';		    		    // 业务扩展参数，目前可添加由支付宝分配的系统商编号(通过setSysServiceProviderId方法)，系统商开发使用,详情请咨询支付宝技术支持			$extendParamsArr = json_encode([				'sys_service_provider_id' => $providerId,				'hb_fq_num' => $HbFqNum,				'hb_fq_seller_percent' => $HbFqSellerPercent,			]);					//构造参数			$payRequestBuilder = new AlipayTradePagePayContentBuilder();			$payRequestBuilder->setBody($body);			$payRequestBuilder->setSubject($subject);			$payRequestBuilder->setTotalAmount($totalAmount);			$payRequestBuilder->setOutTradeNo($outTradeNo);			$payRequestBuilder->setExtendParams($extendParamsArr);					$aop = new AlipayTradePagePayService($pagepayconfig);					/**			 * pagePay 电脑网站支付请求			 * @param $builder 业务参数，使用buildmodel中的对象生成。			 * @param $return_url 同步跳转地址，公网可以访问			 * @param $notify_url 异步通知地址，公网可以访问			 * @return $response 支付宝返回的信息		 	*/			// 网页端			$result['code'] = $aop->pagePay($payRequestBuilder,$pagepayconfig['return_url'],$pagepayconfig['notify_url']);			$file 			= 'alipay';							}		if ( $params['alipay_type'] == 'f2falipay' or $params['alipay_type'] == 'allpay' ) {			require_once __DIR__.'/f2falipay/f2fpay/model/builder/AlipayTradePrecreateContentBuilder.php';			require_once __DIR__.'/f2falipay/f2fpay/service/AlipayTradeService.php';				//商户操作员编号，添加此参数可以为商户操作员做销售统计			$operatorId = "";				// (可选) 商户门店编号，通过门店号和商家后台可以配置精准到门店的折扣信息，详询支付宝技术支持			$storeId = "";				// 支付宝的店铺编号			$alipayStoreId= "";				// 业务扩展参数，目前可添加由支付宝分配的系统商编号(通过setSysServiceProviderId方法)，系统商开发使用,详情请咨询支付宝技术支持						$extendParams = new ExtendParams();			$extendParams->setSysServiceProviderId($providerId);			$extendParams->setHbFqNum($HbFqNum);			$extendParams->setHbFqSellerPercent($HbFqSellerPercent);			$extendParamsArr = $extendParams->getExtendParams();						// 支付超时，线下扫码交易定义为5分钟			$timeExpress = "60m";				// 商品明细列表，需填写购买商品详细信息，			$goodsDetailList = [];				// 产品明细			if ( $params['Detail'] == 'on' ) {				$invoiceDetail 	= \Illuminate\Database\Capsule\Manager::table('tblinvoiceitems')->where('invoiceid', $params['invoiceid'])->get();					foreach ($invoiceDetail as $key => $value) {					$item[$key] = new GoodsDetail();					$item[$key]->setGoodsId($value->type.'-'.$value->relid);					$item[$key]->setGoodsName($value->description);					$item[$key]->setPrice($value->amount);					$item[$key]->setQuantity(1);					$items[$key] = $item[$key]->getGoodsDetail();				}								$goodsDetailList = $items;			}				//第三方应用授权令牌,商户授权系统商开发模式下使用			$appAuthToken = "";//根据真实值填写				// 创建请求builder，设置请求参数			$qrPayRequestBuilder = new AlipayTradePrecreateContentBuilder();			$qrPayRequestBuilder->setOutTradeNo($outTradeNo);			$qrPayRequestBuilder->setTotalAmount($totalAmount);			$qrPayRequestBuilder->setTimeExpress($timeExpress);			$qrPayRequestBuilder->setSubject($subject);			$qrPayRequestBuilder->setBody($body);			$qrPayRequestBuilder->setUndiscountableAmount($undiscountableAmount);			$qrPayRequestBuilder->setExtendParams($extendParamsArr);			$qrPayRequestBuilder->setGoodsDetailList($goodsDetailList);			$qrPayRequestBuilder->setStoreId($storeId);			$qrPayRequestBuilder->setOperatorId($operatorId);			$qrPayRequestBuilder->setAlipayStoreId($alipayStoreId);				$qrPayRequestBuilder->setAppAuthToken($appAuthToken);			// 调用qrPay方法获取当面付应答			$qrPay = new AlipayTradeService($config);			$qrPayResult = $qrPay->qrPay($qrPayRequestBuilder);						//	根据状态值进行业务处理			switch ($qrPayResult->getTradeStatus()){				case "SUCCESS":					//echo "支付宝创建订单二维码成功:"."<br>---------------------------------------<br>";					$response 			= $qrPayResult->getResponse();					$result['qrcode'] 	= $response->qr_code;						// 移动端					if ( isMobile() && $params['isMobile'] == 'on' ) {						$file = 'mobile';					} else {						$file = 'alipay';					}					break;				case "FAILED":					//echo "支付宝创建订单二维码失败!!!"."<br>--------------------------<br>";					if(!empty($qrPayResult->getResponse())){						//print_r($qrPayResult->getResponse());						$code = $qrPayResult->getResponse()->sub_msg;					}					break;				case "UNKNOWN":					//echo "系统异常，状态未知!!!"."<br>--------------------------<br>";					if(!empty($qrPayResult->getResponse())){						//print_r($qrPayResult->getResponse());						$code = $qrPayResult->getResponse()->sub_msg;					}					break;				default:					$code = "不支持的返回状态，创建订单二维码返回异常!!!";					break;			}		}		if ( !empty( $result['qrcode'] ) or !empty( $result['code'] ) ) {			$ext = new NeWorld\Extended;			$code = $ext->getSmarty([			    'dir' 	=> __DIR__ . '/f2falipay/templates/',		        'file' 	=> $file,		        'vars' 	=> $result,		    ]);		}		return $code;	} else {		return '<img style="width: 120px" src="data:image/png;base64," alt="支付宝支付" />';	}}function f2falipay_refund($params) {	header("Content-type: text/html; charset=utf-8");	require_once 'f2falipay/f2fpay/model/builder/AlipayTradeRefundContentBuilder.php';	require_once 'f2falipay/f2fpay/service/AlipayTradeService.php';    // Gateway Configuration Parameters    $accountId = $params['accountID'];    $secretKey = $params['secretKey'];    $testMode = $params['testMode'];    $dropdownField = $params['dropdownField'];    $radioField = $params['radioField'];    $textareaField = $params['textareaField'];    // Transaction Parameters    $transactionIdToRefund = $params['transid'];    $refundAmount = $params['amount'];    $currencyCode = $params['currency'];    // Client Parameters    $firstname = $params['clientdetails']['firstname'];    $lastname = $params['clientdetails']['lastname'];    $email = $params['clientdetails']['email'];    $address1 = $params['clientdetails']['address1'];    $address2 = $params['clientdetails']['address2'];    $city = $params['clientdetails']['city'];    $state = $params['clientdetails']['state'];    $postcode = $params['clientdetails']['postcode'];    $country = $params['clientdetails']['country'];    $phone = $params['clientdetails']['phonenumber'];    // System Parameters    $companyName = $params['companyname'];    $systemUrl = $params['systemurl'];    $langPayNow = $params['langpaynow'];    $moduleDisplayName = $params['name'];    $moduleName = $params['paymentmethod'];    $whmcsVersion = $params['whmcsVersion'];    $invoice = \Illuminate\Database\Capsule\Manager::table('tblaccounts')->where('transid', $transactionIdToRefund)->first();    // f2falipay	$out_trade_no = date('YmdH', strtotime($invoice->date)) . $invoice->invoiceid;	//print_r($out_trade_no);die();	$refund_amount = $refundAmount;	$out_request_no = $transactionIdToRefund;	//第三方应用授权令牌,商户授权系统商开发模式下使用	$appAuthToken = "";//根据真实值填写	//创建退款请求builder,设置参数	$refundRequestBuilder = new AlipayTradeRefundContentBuilder();	$refundRequestBuilder->setOutTradeNo($out_trade_no);	$refundRequestBuilder->setRefundAmount($refund_amount);	$refundRequestBuilder->setOutRequestNo($out_request_no);	$refundRequestBuilder->setAppAuthToken($appAuthToken);	//初始化类对象,调用refund获取退款应答	$refundResponse = new AlipayTradeService($config);	$refundResult =	$refundResponse->refund($refundRequestBuilder);	//根据交易状态进行处理	switch ($refundResult->getTradeStatus()){		case "SUCCESS":			//echo "支付宝退款成功:"."<br>--------------------------<br>";			//print_r($refundResult->getResponse());		    $code =  [		        // 'success' if successful, otherwise 'declined', 'error' for failure		        'status' => 'success',		        // Data to be recorded in the gateway log - can be a string or array		        'rawdata' => $refundResult->getResponse()->gmt_refund_pay,		        // Unique Transaction ID for the refund transaction		        'transid' => $refundResult->getResponse()->out_trade_no,		        // Optional fee amount for the fee value refunded		        'fees' => $refundResult->getResponse()->refund_fee,		    ];		    logTransaction('f2falipay', json_encode($refundResult->getResponse()), $code['status']);			break;		case "FAILED":			//echo "支付宝退款失败!!!"."<br>--------------------------<br>";			//if(!empty($refundResult->getResponse())){			//	print_r($refundResult->getResponse());			//}			$code = array(		        // 'success' if successful, otherwise 'declined', 'error' for failure		        'status' => 'error',		        // Data to be recorded in the gateway log - can be a string or array		        'rawdata' => $refundResult->getResponse()->gmt_refund_pay,		    );		    logTransaction('f2falipay', json_encode($refundResult->getResponse()), $code['status']);			break;		case "UNKNOWN":			echo "系统异常，订单状态未知!!!"."<br>--------------------------<br>";			if(!empty($refundResult->getResponse())){				print_r($refundResult->getResponse());			}			break;		default:			echo "不支持的交易状态，交易返回异常!!!";			break;	}	return $code;}if ( !function_exists('isMobile') ) {	function isMobile() {		$user_agent = $_SERVER['HTTP_USER_AGENT'];		$mobile_browser = [			"mqqbrowser", //手机QQ浏览器			"opera mobi", //手机opera			"juc","iuc",//uc浏览器			"fennec","ios","applewebKit/420","applewebkit/525","applewebkit/532","ipad","iphone","ipaq","ipod",			"iemobile", "windows ce",//windows phone			"240×320","480×640","acer","android","anywhereyougo.com","asus","audio","blackberry","blazer","coolpad" ,"dopod", "etouch", "hitachi","htc","huawei", "jbrowser", "lenovo","lg","lg-","lge-","lge", "mobi","moto","nokia","phone","samsung","sony","symbian","tablet","tianyu","wap","xda","xde","zte"		];		$is_mobile = false;			foreach ($mobile_browser as $device) {			if (stristr($user_agent, $device)) {				$is_mobile = true;				break;			}		}		return $is_mobile;	}}?>